[{:code2 {:label "Templates", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :code2, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns doc.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n:cljs\n\n(def use-defaults? :aerial.hanami.common/use-defaults?)\n\n(defn xframes [frame-map & {:keys [defaults?] :or {defaults? false}}]\n  (let [submap (merge {use-defaults? defaults?} frame-map)]\n    (hc/xform\n     (hc/get-default :USERDATA)\n     submap)))\n\n(defn xc\n  ([comps submap]\n   (hc/xform comps submap))\n  ([comps k v & kvs]\n   (apply hc/xform comps k v kvs)))\n\n(def sidebar\n  [['p {:style {:width \"50px\" :min-width \"50px\"}}]\n   ['v-box :children\n    :components]])\n\n(def top\n  [['gap :size :TOPGAP]\n   ['v-box :children\n    :components]])\n\n\n(def sliderInput\n  '[v-box :children\n    [[label :label [:span.bold :SLIDER-LBL]]\n     [h-box :children\n      [[label :label :MINLBL]\n       [slider\n        :model :SLIDER-MODEL\n        :min :MIN, :max :MAX, :step :STEP\n        :width :SLIDER-WIDTH\n        :on-change :SLIDER-CHG-FNSYM]\n       [label :label :MAXLBL]]]]])\n\n\n(def singleDropdown\n  ['v-box\n   :children\n   [['label :label [:span.bold :DROPDOWN-LBL]]\n    ['single-dropdown\n     :choices :CHOICES\n     :on-change :DROPDOWN-CHG-FNSYM\n     :model :DROPDOWN-MODEL\n     :placeholder :PLACEHOLDER\n     :width :DROPDOWN-WIDTH]]])\n\n\n(def textInput\n  '[input-text\n    :model :INPUT-MODEL\n    :width \"60px\", :height \"26px\"\n    :on-change :INPUT-CHG-FNSYM])\n\n(def markdown\n  ['md {:style {:font-size \"24px\" :width \"1000px\"}}\n   :MDTXT])\n\n(def slider-hist\n  (-> ht/view-base\n    (assoc :mark (merge ht/mark-base {:type \"bar\"})\n           :encoding :BINNED-ENCODING\n           :usermeta\n           (xframes\n            {:TOP (xc top use-defaults? false :components [markdown])\n             :LEFT (xc sidebar\n                       use-defaults? false\n                       :components [sliderInput textInput])}))))\n\n\n(def layer-hist\n  (-> ht/layer-chart\n    (assoc :usermeta (xframes\n                      {:TOP (xc top use-defaults? false :components [markdown])\n                       :LEFT sidebar})\n           :layer [(hc/xform\n                    ht/bar-chart :WIDTH 700\n                    :XTITLE \"Duration (in minutes)\"\n                    :ENCODING :BINNED-ENCODING :Y :Frequency\n                    :DATA :bin-data)\n                   (hc/xform\n                    ht/line-chart :WIDTH 700 :MCOLOR \"red\"\n                    :DATA :den-data)]\n           :resolve{:scale {\"y\" \"independent\" \"x\" \"independent\"}})))\n\n\n(let [mdwn-brush\n      (hc/xform ht/interval-brush-mdwn :MDWM-NAME \"brush\" :IRESOLVE \"global\")\n      color {:field \"NM\" :type \"nominal\"\n             :scale {:range [\"#e45756\" \"#54a24b\" \"#4c78a8\"]}}\n      size {:condition {:selection {:not \"brush\"} :value 40} :value 400}\n      tooltip `[{:field \"Gene\", :type \"nominal\"}\n                ~@ht/default-tooltip\n                {:field \"pvalue\", :type \"quantitative\"}]]\n  (def dge-chart\n    (-> ht/hconcat-chart\n      (assoc #_#_:usermeta\n             (xframes {:TOP (xc top use-defaults? false :components [markdown])\n                       :RIGHT (xc sidebar use-defaults? false\n                                  :components [singleDropdown])})\n             :hconcat\n             [(hc/xform\n               ht/point-chart :WIDTH 500 :HEIGHT 400\n               :TITLE \"MA Plot\"\n               :MSIZE 40\n               :SELECTION (merge  (hc/xform ht/interval-scales :INAME \"grid1\")\n                                  mdwn-brush)\n               :X \"baseMean\", :Y \"log2FoldChange\"\n               :COLOR color, :SIZE size, :TOOLTIP tooltip)\n              (hc/xform\n               ht/point-chart :WIDTH 500 :HEIGHT 400\n               :TITLE \"Volcano Plot\"\n               :MSIZE 40\n               :SELECTION (merge (hc/xform ht/interval-scales :INAME \"grid2\")\n                                 mdwn-brush)\n               :X \"log2FoldChange\", :Y \"-log10pval\"\n               :COLOR color, :SIZE size :TOOLTIP tooltip)]))))\n\n\n(hc/update-defaults\n :BINNED-ENCODING\n {:x {:field :bin_start :type :quantitative\n      :bin {:binned true :step 2}\n      :title :XTITLE}\n  :x2 {:field :bin_end}\n  :y {:field :Y :type :quantitative}}\n :TOPGAP \"500px\" :MDTXT \"Your text here\"\n :SLIDER-LBL \"**Slider Lable**\"\n :SLIDER-WIDTH \"200px\" :STEP 1.0 \n :MIN 0 :MINLBL #(-> % :MIN str)\n :MAX 10 :MAXLBL #(-> % :MAX str)\n :DROPDOWN-MODEL nil :DROPDOWN-WIDTH \"150px\"\n :INPUT-CHG-FNSYM #(-> % :SLIDER-CHG-FNSYM)\n :INPUT-MODEL #(-> % :SLIDER-MODEL))\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n:end", :out-height "900px", :eid "ed-code2", :height "900px"}}, :specs []}} {:code {:label "Code", :opts {:order :row, :eltsper 1, :size "auto", :wrapfn {:tid :code, :$split nil, :out-width "1300px", :fn [quote editor-repl-tab], :layout :left-right, :ns doc.code, :ed-out-order :first-last, :width "730px", :md-defaults nil, :src "\n:clj\n\n(deps '[[techascent/tech.ml.dataset \"4.04\"]])\n(require '[tech.ml.dataset :as ds]\n         '[tech.v2.datatype :as dtype])\n\n(def home-data \"https://raw.githubusercontent.com/jsa-aerial/saite/master/examples/Data/\")\n\n(def faithful\n  (ds/->dataset (fs/join home-data \"faithful.csv\") {:key-fn keyword}))\n\n;;;(ds/filter #(< 50 (% :waiting) 52) faithful)\n;;;(-> faithful (ds/column :waiting) (dtype/->reader :int) vec)\n;;;(-> faithful (ds/column :waiting) (->> (apply max)))\n\n(defn roundit [r & {:keys [places] :or {places 2}}]\n  (let [n (Math/pow 10.0 places)]\n    (-> r (* n) Math/round (/ n))))\n\n\n(defn rseq [b e & {:keys [by len]}]\n  (let [b (float b) e (float e)\n        len (float (or len (-> e (- b))))\n        step (float (or by (-> e (- b) (/ (dec len)))))\n        sq (mapv #(roundit % :places 5) (range b e step))]\n   