), length.out = %s)\" len)\n        breaks (-> rcd r r->clj)]\n    (->> breaks (coll/sliding-take 2) (coll/takev-while #(= 2 (count %)))\n      (mapv (fn[[b e]]\n              {:bin_start b\n               :bin_end e\n               :Frequency (ds/row-count\n                           (ds/filter #(<= b (% :eruptions) e) faithful))})))))\n\n(defn density [bw]\n  (let [rcd (format \"density(faithful$eruptions, adjust = %s)\" bw)]\n    (-> rcd r r->clj)))\n\n(defn gen-den-data [val]\n  (let [den (density val)]\n    (take-nth 5 (mapv (fn[x y] {:x (roundit x :places 2)\n                                :y (roundit y :places 4)})\n                      (den :x) (den :y)))))\n\n:none\n(take 10 (clj (let [den (density 1.0)]\n                (mapv (fn[x y] {:x x :y y}) (den :x) (den :y)))))\n\n\n:cljs\n(def dendata (atom nil))\n(def bindata (atom nil))\n(def Rquake-schema [:Y :Frequency :XTITLE \"Duration (in minutes)\"])\n\n\n:mixed\n(let [den-data (clj (gen-den-data 1.0))]\n  (reset! dendata den-data) :done)\n\n(defn bins-fn [val vid model]\n  (let [spec-frame-pairs (hmi/get-cur-tab :spec-frame-pairs)\n        den-data (-> dendata deref)\n        bin-data (clj (rbins val))]\n    (reset! model (str val))\n    (hmi/visualize\n     (apply hc/xform layer-hist\n            :bin-data bin-data :den-data den-data Rquake-schema)\n     (js/document.getElementById (name vid)))))\n\n(defn density-fn [val vid model]\n  (let [spec-frame-pairs (hmi/get-cur-tab :spec-frame-pairs)\n        bincnt (-> :m3 sc/get-ratom deref js/parseInt)\n        bin-data (clj (rbins bincnt))\n        den-data (clj (gen-den-data val))]\n    (reset! dendata den-data)\n    (reset! model (str val))\n    (hmi/visualize\n     (apply hc/xform layer-hist\n            :bin-data bin-data :den-data den-data Rquake-schema)\n     (js/document.getElementById (name vid)))))\n\n:cljs\n(let [sval (sc/add-ratom :m3 \"20\")\n      chgfn #(bins-fn % :rhist sval)]\n  (sc/add-symxlate 'bins-fn chgfn))\n\n(let [sval (sc/add-ratom 